import React from 'react';

function Result(){

  const data = useLocation().search;

  const queries = new URLSearchParams(data);

  return (
    <div>
    <h1>Result</h1>
    <p>Input 1: {queries.get("name")}</p>
    <p>Input 2: {queries.get("range")}</p>
  </div>
  );
};

export default Result;
